import { React } from "react";

export const GenerateTable = ({ headings, items }) => {
  //   console.log(project_data);
  if (items) {
    return (
      <table className="table">
        <thead>
          <tr>
            {headings.map((heading_name) => {
              console.log(heading_name.heading);
              <td>{heading_name.heading}</td>;
            })}
          </tr>
        </thead>
        <tbody>
          {items.map((row, table_row) => (
            <tr key={table_row}>
              {Object.values(row).map((row_value, table_data) => (
                <td key={table_data}>{row_value}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    );
  } else {
    return (
      <table className="table">
        <tbody>
          <tr>
            <td>No data found</td>
          </tr>
        </tbody>
      </table>
    );
  }
};
